for (const type of [
  BlockType.SolidColorCube,
  BlockType.SolidColorSlab,
  BlockType.SolidColorWallDecoration,
  BlockType.SolidColorTile,
  BlockType.SolidColorPillar,
]) {
  const start =
    type * 100000 +
    (type === BlockType.SolidColorSlab || type === BlockType.SolidColorTile
      ? 2
      : 1);
  for (let i = 0; i < 4096; i++) {
    const id = start + i;
    BLOCKS[id] = {
      type: TypeMap[type]!,
      textureIndex: i,
      name: `rgb(${((i << 8) & 0xf) * 16}, ${((i << 4) & 0xf) * 16}, ${
        (i % 16) * 16
      })`,
      priority: 3e8 * type + i,
      isSolidColor: true,
    };
  }
}

const pairs = Object.entries(BLOCKS);
for (let [id, data] of pairs) {
  if (data.type === BlockType.Slab || data.type === BlockType.Tile) {
    BLOCKS[+id - 1] = { ...data };
    BLOCKS[+id - 1]!.isUpperSlab = true;
    data.isLowerSlab = true;
  }
}
